ib:
  inputs: ./BabylonHealth/Scenes
  outputs:
    - templateName: scenes-swift4
      output: ./BabylonHealth/Generated Code/Storyboard Scenes.swift
    - templateName: segues-swift4
      output: ./BabylonHealth/Generated Code/Storyboard Segues.swift
xcassets:
  inputs: ./BabylonHealth/Assets.xcassets
  outputs:
    templateName: swift4
    output: ./BabylonHealth/Generated Code/Assets.swift
